import React from "react";

class AddInstructor extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      title: "",
      rate: "",
      rating: 0,
      date: Date,
      review: ""
    };
  }

  onChangeName = e => {
    this.setState({
      name: e.target.value
    });
  };

  onChangeTitle = e => {
    this.setState({
      title: e.target.value
    });
  };

  onChangeRate = e => {
    this.setState({
      rate: e.target.value
    });
  };

  onChangeRating = e => {
    this.setState({
      rating: e.target.value
    });
  };

  onChangeDate = e => {
    this.setState({
      date: e.target.value
    });
  };

  onChangeReview = e => {
    this.setState({
      review: e.target.value
    });
  };

  onSubmit = e => {
    e.preventDefault();

    this.setState = {
      name: "",
      title: "",
      rate: "",
      rating: 0,
      date: Date,
      review: ""
    };
  };

  render() {
    return (
      <div>
        <h3>can't find your instructor?</h3>
        <button>add here</button>
        <form>
          <input type="text" placeholder="name" /> <br />
          <input type="text" placeholder="title" />
          <br />
          <input type="text" placeholder="rate" />
          <br />
          <input
            type="number"
            placeholder="rating"
            min="1"
            max="5"
            style={{ width: "60px" }}
          />
          <br />
          <input type="date" placeholder="date" />
          <br />
          <input type="text" placeholder="review" />
        </form>
      </div>
    );
  }
}

export default AddInstructor;
